import React, { useEffect, useState } from 'react';
import LoadingScreen from '../resources/loadingScreen';

// Reducer 
import GetPointLeaders from '../../reducers/LeadersAPI';


const PointLeaders = (data) => {
    const [ pointLeaders, setPointLeaders ] = useState(null);
    const [ loaded, setLoaded ] = useState(false); 

    useEffect(()=>{
        const ptldrs = GetPointLeaders(data);
        setPointLeaders(ptldrs);
        setLoaded(true);
    }, [])

    if(!loaded) { 
        return (
            <LoadingScreen />
        )
    } else {
        return (
            <div className="point-leaders">
                <div className="point-leader-card">
                    {/* Team Logo */}
                    {/* <img src={} alt="" /> */}
                    <h4>{pointLeaders.first.fn[0]}.{pointLeaders.first.ln}</h4>
                    <p>{pointLeaders.first.pts}</p>
                    <p>{pointLeaders.first.ast}</p>
                    {/* Player Img */}
                    {/* <img src={} alt="" /> */}
                </div>

                <div className="point-leader-card">
                    {/* Team Logo */}
                    {/* <img src={} alt="" /> */}
                    <h4>{pointLeaders.second.fn[0]}.{pointLeaders.second.ln}</h4>
                    <p>{pointLeaders.second.pts}</p>
                    <p>{pointLeaders.second.ast}</p>
                    {/* Player Img */}
                    {/* <img src={} alt="" /> */}
                </div>

                <div className="point-leader-card">
                    {/* Team Logo */}
                    {/* <img src={} alt="" /> */}
                    <h4>{pointLeaders.third.fn[0]}.{pointLeaders.third.ln}</h4>
                    <p>{pointLeaders.third.pts}</p>
                    {/* Player Img */}
                    {/* <img src={} alt="" /> */}
                </div>
            </div>
        )

    };
}

export default PointLeaders;
